  let postsData = [
    { id: 1, message: "Hi, i am john", likesCount: 12 },
    { id: 2, message: "welcome", likesCount: 18 },
  ];

  return (
    <div>
      <ProfileInfo />
      <MyPosts posts={postsData}/>
    </div>)
}

export default Profile;
